import React from 'react';
import styles from './nav.module.css';

const Nav = () => {
  return (
    <nav className={`nav ${styles.nav}`}>
      <ul>
        <li>
          <a href="/">Explore</a>
        </li>
        <li>
          <a href="/">My courses</a>
        </li>
        <li>
          <a href="/">Become an instructor</a>
        </li>
      </ul>
    </nav>
  );
};

export default Nav;
